import React from 'react';
import { useSelector } from "react-redux";
import { createStructuredSelector } from 'reselect'

import WithSpinner from '../with-spinner/with-spinner'

import { selectCollectionsForPreview, selectIsFetchingCollections } from '../../redux/shop/shop-selectors'

import CollectionPreview from '../collection-preview/CollectionPreview'

import './collection-overviews.scss'

const CollectionsOverview = () => {

    const structuredSelector = createStructuredSelector({
        collections: (state) => selectCollectionsForPreview(state),
        isLoading: (state) => selectIsFetchingCollections(state)
    })

    const { collections } = useSelector(structuredSelector)

    return (
        <div className="collections-overview">

            {

                collections.map(({ id, ...otherCollectionProps }) => {
                    return <CollectionPreview key={id} {...otherCollectionProps} />
                })

            }

        </div>
    );

};

export default CollectionsOverview;
